using System;
using System.Text;

using CMS;
using CMS.Core;
using CMS.DataEngine;
using CMS.MacroEngine;

[assembly: RegisterModule(typeof(MacroModule))]

namespace CMS.MacroEngine
{
    /// <summary>
    /// Represents the Macro module.
    /// </summary>
    public class MacroModule : Module
    {
        /// <summary>
        /// Default constructor
        /// </summary>
        public MacroModule()
            : base(new MacroModuleMetadata())
        {
        }


        /// <summary>
        /// Pre-initialization of the module.
        /// </summary>
        protected override void OnPreInit()
        {
            base.OnPreInit();

            ObjectFactory<IMacroMethod>.SetObjectTypeTo<MacroMethod>();

            MacroHandlers.PreInit();
            MacroDebug.Init();
        }


        /// <summary>
        /// Initializes the module
        /// </summary>
        protected override void OnInit()
        {
            base.OnInit();

            var r = MacroContext.GlobalResolver;

            // Special macros
            r.SetHiddenNamedSourceData("Bunny", Encoding.ASCII.GetString(Convert.FromBase64String("PHByZT4oKV8oKTxiciAvPihvX08pPGJyIC8+KF9fXylvPC9wcmU+")));
            r.SetHiddenNamedSourceData("DalosBond", Encoding.ASCII.GetString(Convert.FromBase64String("")));
            r.SetHiddenNamedSourceData("Dalos", Encoding.ASCII.GetString(Convert.FromBase64String("")));

            // Register object types
            r.SetHiddenNamedSourceData("ObjectTypes", x => ObjectTypeManager.Instance);
        }
    }
}